    false,nt"url": null,nt"notes": "The Light Detection and Ranging (LiDAR)
    dataset is a survey of the Atchafalaya Basin project area. The entire survey area
    for Atchafalaya encompasses approximately 1650.5 square miles. The LiDAR point cloud
    was flown at a nominal post spacing of 1.0 meters for unobscured areas. The LiDAR
    data and derivative products produced are in compliance with the U.S. Geological
    Survey National Geospatial Program LIDAR Guidelines and Base Specifications, Version
    13-ILMF 2010. The flight lines were acquired by Aerial Cartographics of America,
    Inc "ACA", which required eight missions between December 18, 2012 - March 01,
    2013. Derivative products from the aerial acquisition include: raw point cloud data
    in LAS v1.2 format, classified point cloud data in LAS v1.2 format, bare earth surface
    (raster DEM) tiles in 32-bit floating point raster ERDAS .IMG format, breaklines
    in ESRI Arc Shape format, control points in ESRI Arc Shape format, project report,
    and FGDC compliant XML metadata.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
